function ImagePopup(props) {
  return (
    <div className={`popup popup_type_photo ${props.card ? "popup_opened" : ""}`}>
      <div class="popup__photo-open">
        <button type="button" class="popup__button-close" onClick={props.onClose}></button>
        <img class="popup__image"
             src={props.card ? props.card.link : ""}
             alt={props.card ? props.card.name : ""}/>
        <h3 class="popup__photo-about">{props.card ? props.card.name : ""}</h3>
      </div>
    </div>
  );
}

export default ImagePopup;
